import React from 'react'

export const PrimerComponente = () => {
    let nombre = "Aiman";
    let web = "aiman.es";
  return (
    <div>
      <h2>Hola PrimerComponente</h2>
      <p>Mi nombre es: (nombre)</p>
      <p>Mi web es: (web)</p>
    </div>
  )
}
